	b = (YY_BUFFER_STATE) libvma_yyalloc(sizeof( struct yy_buffer_state )  );
	if ( ! b )
		YY_FATAL_ERROR( "out of dynamic memory in libvma_yy_create_buffer()" );

	b->yy_buf_size = size;

