	b->yy_ch_buf = (char *) libvma_yyalloc(b->yy_buf_size + 2  );
	if ( ! b->yy_ch_buf )
		YY_FATAL_ERROR( "out of dynamic memory in libvma_yy_create_buffer()" );

	b->yy_is_our_buffer = 1;

	libvma_yy_init_buffer(b,file );

	return b;
